import React from 'react';
import './Button.css';

const Button = (props) => {
  return (
    <button
      className={`
        button
        ${props.operation ? 'operation' : ''}
        ${props.double ? 'double' : ''}
        ${props.triple ? 'triple' : ''}
      `}
      onClick={(e) => props.click(e.target.inn)}
      >
      { props.label }
    </button>
  )
}

export default Button;
